import { useState, useEffect } from "react";
import { Container, Row, Col, Form } from "react-bootstrap";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { giftCardInf } from "../redux/actions/index.js";
import { useSelector, useDispatch } from "react-redux";
import logo from "../img/Blue_Futuristic_Gaming_Logo-removebg-preview.png";
import * as Icon from "react-bootstrap-icons";

const GiftCard = () => {
  const [formData, updateFormData] = useState("");
  const [sendDate, setSendDate] = useState(new Date());
  const dispatch = useDispatch();
  const [amount, setAmount] = useState(undefined);
  const [name, setName] = useState("");
  const [surname, setSurname] = useState("");
  const [message, setMessage] = useState("");
  const isLoading = useSelector((state) => state.giftData.isLoading);
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState(undefined);
  const [date, setDate] = useState("");
  const handleAmount = (e) => {
    setAmount(e.target.value);
    dispatch(giftCardInf(giftFormData));
  };
  const handleName = (e) => {
    setName(e.target.value);
    dispatch(giftCardInf(giftFormData));
  };
  const handleSurname = (e) => {
    setSurname(e.target.value);
    dispatch(giftCardInf(giftFormData));
  };
  const handleMessage = (e) => {
    setMessage(e.target.value);
    dispatch(giftCardInf(giftFormData));
  };
  const handleEmail = (e) => {
    setEmail(e.target.value);
    dispatch(giftCardInf(giftFormData));
  };
  const handlePhone = (e) => {
    setPhone(e.target.value);
    dispatch(giftCardInf(giftFormData));
  };

  const giftFormData = {
    amount: amount,
    name: name,
    surname: surname,
    message: message,
    email: email,
    phone: phone,
    date: sendDate,
  };
  // const handleChange = (e) => {
  //   updateFormData({
  //     ...formData,

  //     // Trimming any whitespace
  //     [e.target.name]: e.target.value.trim(),

  //   });

  // };
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
    // ... submit to API
  };

  return (
    <Container fluid>
      <Row>
        <img src="" alt="" />
        <div>
          <h1>Impuls Gaming</h1>
          <span>www.impulsgaming.com</span>
        </div>
      </Row>
      <Container>
        <Form onSubmit={handleSubmit}>
          <Row>
            <Col>
              <h2>Give a Gift</h2>
              <h6>Choose amount</h6>
              <hr />
              <Form.Group
                as={Row}
                className="mb-3"
                controlId="formHorizontalEmail"
              >
                <Form.Label column sm={2}>
                  Amount*
                </Form.Label>
                <Col sm={4}>
                  <Form.Control
                    type="number"
                    placeholder="10"
                    min={0}
                    required
                    // onChange={handleChange}
                    onChange={handleAmount}
                  />
                </Col>
              </Form.Group>
              <h6>Personalise</h6>
              <Form.Group>
                <Form.Label column sm={2}>
                  To*
                </Form.Label>

                <Row>
                  <Col>
                    <Form.Control
                      placeholder="First name"
                      required
                      // onChange={handleChange}
                      onChange={handleName}
                    />
                  </Col>
                  <Col>
                    <Form.Control
                      placeholder="Last name"
                      required
                      // onChange={handleChange}
                      onChange={handleSurname}
                    />
                  </Col>
                </Row>
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Message</Form.Label>
                <Form.Control
                  as="textarea"
                  rows={3}
                  // onChange={handleChange}
                  onChange={handleMessage}
                />
              </Form.Group>
              <h6>Schedule Delivery</h6>

              <Form.Group>
                <Form.Label>Send To*</Form.Label>

                <Row>
                  <Col>
                    <Form.Group className="mb-3">
                      <Form.Label>Email </Form.Label>
                      <Form.Control
                        type="email"
                        placeholder="Recipient Email"
                        // onChange={handleChange}
                        onChange={handleEmail}
                      />
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Group className="mb-3">
                      <Form.Label>WhatsApp Number</Form.Label>
                      <Form.Control
                        type="tel"
                        placeholder="Recipient WhatsApp Number"
                        required
                        // onChange={handleChange}
                        onChange={handlePhone}
                      />
                    </Form.Group>
                  </Col>
                </Row>
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Delivery Date *</Form.Label>
                <DatePicker
                  selected={sendDate}
                  onChange={(date) => setSendDate(date)}
                  showTimeSelect
                  dateFormat="Pp"
                />
              </Form.Group>
            </Col>
            <Col>
              <div className="d-flex">
                <div>
                  <img className="logo-img" src={logo} alt="impuls logo" />
                  <div>
                    <Icon.Phone size={25} />
                    <h6 className="py-0 my-0">Phone</h6>
                    <span>+48-79-4144-892</span>
                  </div>
                  <div>
                    <Icon.GeoAltFill size={25} />
                    <h6 className="py-0 my-0">Phone</h6>
                    <span>+48-79-4144-892</span>
                  </div>
                </div>
                <div></div>
              </div>
            </Col>
          </Row>
          <button type="submit">CheckOut</button>
        </Form>
      </Container>
    </Container>
  );
};
export default GiftCard;
